import React, { Component } from 'react';
import '../css/Layout.css';
import "antd/dist/antd.css";
import { Icon,Row,Col } from 'antd';
import {Nav , Navbar,Form,Button,FormControl, Container, } from 'react-bootstrap';

class Layout extends Component {

    render() {
        return (
            <div>
                <div className="layout-top-master-sm">
                        <Navbar bg="light" expand="lg">
                            <Navbar.Brand id="logo-header-sm" href="#home">
                                <img  className="d-inline-block align-top" src="https://res.cloudinary.com/aptech-fpt/image/upload/v1549933837/logo-nal.png"></img>
                            </Navbar.Brand>

                            {/*menu-nav-item-moblie*/}

                            <Navbar.Toggle aria-controls="basic-navbar-nav" />
                            <Navbar.Collapse  id="basic-navbar-nav">
                                <Form inline>
                                    <FormControl id="hhaa" type="text" placeholder="Search" />
                                    <Button variant="outline-success"><i className="fas fa-search"></i></Button>
                                </Form>

                                <Row>
                                    <ul>
                                    <Col span={10}>
                                        <li className="list-group-flush">
                                            <a className="text-decoration-none text-center list-group-item" href="#">hihi</a>
                                        </li>
                                    </Col>
                                    <Col span={10}>
                                        <a className="text-decoration-none text-center list-group-item" href="#">hihi</a>
                                    </Col>
                                    </ul>
                                </Row>
                            </Navbar.Collapse>
                        </Navbar>
                </div>
                <div className="huy">
                    <h3>hihi</h3>
                </div>
            </div>

        );
    }
}
export default Layout;
